def trim_non_alpha(s):
    return re.sub(r'^\W+|\W+$', '', s)
def imprint():
    data = load_data()
    processed_data = {}
    for book in data:
        i = book["hostItem"].get('imprint').find(':')
        if i != -1:
            city = book["hostItem"].get('imprint')[:i]
        else:
            city = book["hostItem"].get('imprint')
        city = city.strip()
        city = trim_non_alpha(city)
        time = extract_number_from_string(book["hostItem"].get('imprint'))
        processed_data[book['id']] = [city,time]
    return processed_data

def extract_number_from_string(s):
    last_space_index = s.rfind(' ')
    if last_space_index == -1:
        return None
    last_part = s[last_space_index+1:]

    match = re.search(r'\b\d{4}\b', last_part)

    if match:
        return int(match.group())
    else:
        return None

